import { ClientCircuitArtifactNames, getClientCircuitArtifact, getClientCircuitVkData } from '../../client_artifacts_helper.js';
export class LazyArtifactProvider {
    getClientCircuitArtifactByName(artifact) {
        return getClientCircuitArtifact(ClientCircuitArtifactNames[artifact], false);
    }
    getSimulatedClientCircuitArtifactByName(artifact) {
        return getClientCircuitArtifact(ClientCircuitArtifactNames[artifact], true);
    }
    getCircuitVkByName(artifact) {
        return getClientCircuitVkData(ClientCircuitArtifactNames[artifact]);
    }
}
